import React from 'react';
import { Form, Input, Button, Card } from 'antd';

const Profile = () => {
    return (
        <>
            <br />
            <div>
                <Card
                title="닉네임 수정">
                <Form style={{ margin : '10px'}}>
                    <Input ></Input>
                    <Button type="primary">수정</Button>
                </Form>
                </Card>
            </div>
        </>
    );
};

export default Profile;
